import React from 'react';
import Header from '../Header/index'
import Landing from '../Landing/index'
import Footer from '../Footer/index'
import Welcome from '../Welcome/index'

import '../../App.css';

function App() {
  return (
    <div >
      <Header />
      <Welcome />
      <Landing />
      <Footer />
    </div>
  );
}

export default App;
